import React from "react";
import Launch from "./Launch";
import { Routes, Route } from "react-router-dom";


function Main(){
    return(
        <div>
            <h1>hello</h1>
        <Routes>
            <Route path='/launch' element={<Launch />} />
        </Routes>
        </div>
    )
}

export default Main
